import Card from "./Card";
import UserCard from "./UserCard";

export default function MovieGrid({ listMovies }) {
  return (
    <>
      <div>
        <ul className="layoutDePelis">
          {listMovies?.map((element) => {
            return <Card key={element.id} movie={element} />;
          })}
        </ul>
      </div>
    </>
  );
}
